    const dispatch = useDispatch()
    const currentUser = useSelector(state => state.user.currentUser)
    return ( 
        <div>
            Привет, {currentUser.nickname}
        </div>,
        <label>
        <div className = "wrap">
          <InputGroup>
          <InputGroup.Prepend>
          <InputGroup.Text>First and last name</InputGroup.Text>
          </InputGroup.Prepend>
          <FormControl />
          <FormControl />
          </InputGroup>
    <Button>Выдать ключ сотруднику</Button>
    </div>
    </label>
        
    );
};
